    override fun sempred(_localctx: RuleContext?, ruleIndex: Int, actionIndex: Int): Boolean {
		when (ruleIndex) {
            55 -> return HEX_sempred(_localctx, actionIndex)
            56 -> return BIN_sempred(_localctx, actionIndex)
            64 -> return TYPE_ID_sempred(_localctx, actionIndex)
            66 -> return SPACE_ID_sempred(_localctx, actionIndex)
		}
		return true
	}

    private fun HEX_sempred(_localctx: RuleContext?, actionIndex: Int): Boolean {
		when (actionIndex) {
            0 -> return _input.LA(1) != '{'.code
		}
		return true
	}

